so in react you can do this
```var RepeatModule = React.createClass({
  getDefaultProps: function() {
    return { items: [] }
  },
  render: function() {

    var listItems = this.props.items.map(function(item) {
      return (
        &lt;li key="{item.name}"&gt;
          &lt;a href="{item.link}"&gt;{item.name}&lt;/a&gt;
        &lt;/li&gt;
      );
    });

    return (
        &lt;ul&gt;
          {listItems}
        &lt;/ul&gt;
    );
  }
});```

but in angular, you can do something like this
```&lt;tr ng-repeat="x in names"&gt;
    &lt;td&gt;{{ x.Name }}&lt;/td&gt;
    &lt;td&gt;{{ x.Country }}&lt;/td&gt;
  &lt;/tr&gt;
```

Yeah but it can get even deeper. React can't figure out how to do the same tag element after each other, so you could never put
```var listItems = this.props.items.map(function(item) {
      return (
        &lt;div&gt;hello&lt;/div&gt;
        &lt;div&gt;goodbye&lt;/div&gt;
      );
    });```

